import BasicButton from "../comm/BasicButton";
import CircleButton from "../comm/CircleButton";

const CalCalrorie2 = () => {
    return (
        <div className="sticky flex py-20 space-x-20 justify-center ">
            <CircleButton name="일별칼로리" color="" background="white"/>
            <CircleButton name="주별칼로리" color="pink" background="white"/>
            <CircleButton name="월별칼로리" color="blue" background="white"/>

        </div>
    );
}

export default CalCalrorie2
